insert into project 
 values ('Ηλεκτρική διασύνδεση της Κρήτης με την Πελοπόννησο',284931.00,'2022-3-18','2024-2-10','Χρονοδιαγράμματα αρέσει μέχρι γέλασαν αρέσει συγγραφής γραμμής. Παίρνει αφήσεις εδώ κρατάει επί αρέσει. Πάντως περιεχόμενα διακόψουμε εδώ. Αν δύο μεταφραστής άρα κοιτάζοντας να κρατήσουν. Από μαγικά σκεφτείς ανά του αρπάζεις αποδείξεις.',8,27,1,51,9,'2020-3-11','Εθνικό Μετσόβιο Πολυτεχνείο');
insert into project 
 values ('Μονάδα Επεξεργασίας Απορριμμάτων (ΜΕΑ) Ηλείας',406955.00,'2021-10-18','2024-2-11','Ταξινομεί χρησιμοποιώντας έχω γνωστή πες διαπιστώνεις. Δημιουργια τι στέλνοντάς πάντα μέσης άρα παίξουν καταλάθος. Λίγο περιεχόμενα αποκλειστικούς κύκλο προσεκτικά. Παίξουν λίγο μέσης θέμα διορθώσεις. Πάντως ήδη επί χρονοδιαγράμματος. Συγγραφείς άλγεβρα αρπάζεις πάντως.',1,17,8,58,5,'2019-11-17','Οικονομικό Πανεπιστήμιο Αθηνών');
insert into project 
 values ('Επέκταση του Μετρό Αθήνας, τμήμα Χαϊδάρι - Πειραιάς',191915.00,'2021-7-25','2024-9-2','Έτσι χειρότερα κόλπα αγοράζοντας συγχρόνως επιδιόρθωση μην. Έτσι του εκτελέσεις ωραίο αν πες. Δουλεύει νέων σίγουρος χάος. Βάζοντας μιας αυτός κανόνα.',6,27,15,65,8,'2019-8-9','Πολυτεχνείο Κρήτης');
insert into project 
 values ('Αποκατάσταση του αρχαίου θεάτρου της Απτέρας',995106.00,'2022-5-21','2025-8-19','Κάτι αποδείξεις τοπικές νέου γραμμές. Ευκολότερο δε αν διασφαλίζεται εφαρμογή πηγαίου. Το σου τους εκτελείται να πρώτοι εργαζόμενοι. Ταξινομεί αποκλειστικούς αγοράζοντας τη διευθυντές εφαρμογής.',1,18,22,72,7,'2020-4-22','ΕΛΙΝΟΙΛ');
insert into project 
 values ('Σήραγγες Τεμπών',902801.00,'2021-2-9','2024-6-8','Πιο καλύτερο καλύτερο νέων. Κώδικάς ότι τι. Δεν απαρατήρητο ότι λετπά που.',17,2,29,79,5,'2019-9-1','ΚΑΠΝΟΒΙΟΜΗΧΑΝΙΑ ΚΑΡΕΛΙΑ');
insert into project 
 values ('Λειτουργία Τοπικών Ομάδων Υγείας (ΤΟΜΥ) για την αναδιάρθρωση της Πρωτοβάθμιας Φροντίδας Υγείας',717274.00,'2022-11-21','2025-9-15','Λιγότερο εργαζόμενοι προγραμματιστής θα. Ας εκείνου συγγραφής κλπ εφαρμογή. Ανώδυνη μετράει μάθε υπηρεσία παραδώσεις χαρακτηριστικών λιγότερο πάντα. Εκθέσεις στα άπειρα διάβασε μάτσο. Πιο απόλαυσε που διαφήμιση μπορούσες χρησιμοποιώντας.',2,21,36,86,9,'2020-2-22','Eθνικό Αστεροσκοπείο Αθηνών');
insert into project 
 values ('Κέντρο Διαλογής Ανακυκλώσιμων Υλικών Ρόδου',940762.00,'2022-6-25','2024-10-11','Υπηρεσία τα έτσι εξοργιστικά έστειλε. Στη μια να έτσι μέσης άρα. Για ας υπηρεσία επί τις στη όταν γραφικά. Στο έχω άρθρων σαν ερωτήσεις αντιλήφθηκαν.',7,2,43,93,6,'2020-9-8','Εθνικό Κέντρο Κοινωνικών Ερευνών');
insert into project 
 values ('Σύστημα τηλεματικής ΟΑΣΑ',512462.00,'2022-12-18','2024-7-7','Συνέχεια περιμένουν χειρότερα για αθόρυβες επί. Κι σαν διευθυντές προσθέσει τη ελέγχου τεκμηριώνει. Χρησιμοποίησέ απλό πως φαινόμενο κανένας επί μη.',4,22,50,100,3,'2020-10-28','Ινστιτούτο Συστημάτων Επικοινωνιών και Υπολογιστών');
insert into project 
 values ('Σχεδίαση και κατασκευή νανοδορυφόρου από το Δημοκρίτειο Πανεπιστήμιο Θράκης',846909.00,'2021-11-28','2024-9-13','Στη την ανά. Γραμμής εξακολουθεί κλπ πολύ πάντα. Μετρήσεις μου δύο ερώτηση τρέξει. Ανά τύπους χρησιμοποιώντας γειτονιάς πακέτων με. Είχαμε πρώτο βιβλίο σε φακέλους σκεφτείς.',18,30,57,107,9,'2019-7-20','Ιατρική Σχολή Αθηνών');
insert into project 
 values ('Αποκατάσταση και ανάδειξη εκκλησίας Παναγιάς του Κάστρου',489625.00,'2022-3-13','2025-12-17','Ένα δεν εκείνου ελέγχου προκύπτουν πετάξαμε οι εντολές. Ταξινομεί επιδιόρθωση τα περιβάλλον. Υπηρεσία δημιουργήσεις ο τρέξει απόλαυσε ναι. Όχι άρα σκεφτείς επεξεργασία μέχρι. Προσπαθήσεις θέματα άρα χρονοδιαγράμματα. Σας διαπιστώνεις εκτός νέων.',1,24,64,114,6,'2020-11-27','Χαροκόπειο Πανεπιστήμιο Αθηνών');
insert into project 
 values ('Επαναδημιουργία Λίμνης Κάρλας',196519.00,'2021-6-6','2024-1-20','Έτσι για εκτός στέλνοντάς δημιουργια. Ναι αλγόριθμου ωραίο χρονοδιαγράμματα πως έτσι τις χρησιμοποιούνταν. Διολισθήσεις φακέλους τέλειοι μη. Μέσης ίδιο λοιπόν ερώτηση. Θέλεις σαν πεδία μπορούσες.',4,37,71,121,1,'2019-12-17','ΕΛΒΑΛΧΑΛΚΟΡ');
insert into project 
 values ('Συσκευές προστασίας νεαρών ψαριών',431468.00,'2021-11-20','2023-2-15','Πήρε εταιρείες μετρήσεις που όσο θέμα. Αυτός έξι δημιουργια εργαζόμενοι οι εφαμοργής διορθώσεις πάρα. Κάτι εξακολουθεί περιμένουν αλγόριθμου όχι.',11,11,78,128,8,'2019-11-14','ΟΜΙΛΟΣ MARFIN');
