 values ('Δίκτυα οικονομίας, εξουσίας και γνώσης στον ελληνικό χώρο από τους προϊστορικούς χρόνους έως τη σύγχρονη εποχή',360685.00,'2021-8-19','2024-11-8','Σου δημιουργήσεις βάζοντας κύκλο μετράει πολύ. Το ρωτήσει κόλπα περιμένουν συνεχώς πλέον. Συνάδελφος ο εγώ ποσοστό σε πάντως στα.',15,1,85,135,5,'2019-10-22','REVOIL Α.Ε.Ε.Π.');
insert into project 
 values ('ΠΡΙΣΜΑ - Εθνικό πληροφοριακό σύστημα για τις ακτινοβολίες',414195.00,'2021-7-6','2023-11-4','Αρχεία πόρτες έγραψες εργαζόμενοι ήδη μέγιστη πετάνε. Μιας μου μέρος μη επιστρέφουν. Τον κόλπα σίγουρος. Αποθηκευτικού χρησιμοποίησέ χαμηλός το ένα μου από.',19,17,92,142,9,'2019-4-16','Εθνικό Κέντρο Έρευνας Φυσικών Επιστημών ΔΗΜΟΚΡΙΤΟΣ');
insert into project 
 values ('Κέντρα Κοινότητας',451891.00,'2021-9-16','2023-3-15','Σπίτι δύο οι που αντιλήφθηκαν. Τι σας πρώτης ανακλύψεις πάντως. Τελειώσει μάλλον δημιουργια. Επί πως τρόπο δυστυχής ορίστε κόλπα κλπ. Παίρνουν ερωτήσεις προσπαθούν με. Σε χαμηλός στο αθόρυβες.',3,29,99,149,8,'2019-10-24','Ινστιτούτο Δασικών Ερευνών');
insert into project 
