insert into project 
 values ('ΠΡΟΤΕΑΣ - Προηγμένες διαστημικές εφαρμογές για την εξερεύνηση του σύμπαντος, του διαστήματος και της Γης',596211.00,'2022-5-26','2025-11-25','Την στις οι κάνε. Αναφορά εργασίας εδώ μέχρι τέλειοι αρχεία πηγαίου. Ναι ανακλύψεις την τις κοιτάζοντας. Περιμένουν γραμμής αν ίδιο. Ταξινομεί επεξεργασία ως ροή λες όταν ως. Ανταγωνιστής βρίσκονται μιας ας. Ήδη αντιλήφθηκαν έχω περισσότερη να.',17,38,113,13,8,'2020-11-9','Πανεπιστήμιο Μακεδονίας');
insert into project 
 values ('Πολιτιστικό Κέντρο - Μουσείο Μύλου Παππά',650383.00,'2022-6-8','2024-5-25','Θυμάμαι σχεδιαστής εδώ. Αποστηθίσει πως ίδιο δημιουργείς λίγο κι χρειάζονται. Στις διασφαλίζεται με απίστευτα εργαζόμενοι. Περισσότερη γραφικά μετράει ναι σας δίνοντας. Διακοπή κρατάει στα εκθέσεις δύο χαρακτηριστικών λες.',16,22,120,20,3,'2020-8-7','ΣΚΛΑΒΕΝΙΤΗΣ');
insert into project 
 values ('Προστασία και ανάδειξη Εθνικού Πάρκου λίμνης Κερκίνης',159148.00,'2021-4-9','2024-8-11','Σας ναι χαρακτηριστικό θέματα. Απομόνωση μεταγλωτιστής εκδόσεις αποθηκευτικού ναι των πάντως. Βιβλίο πλέον ευκολότερο. Ίδιο σταματάς χρόνου αθόρυβες τρέξει να.',16,26,127,27,5,'2019-1-23','ΕΛΛΗΝΙΚΗ ΕΤΑΙΡΕΙΑ ΣΥΜΜΕΤΟΧΩΝ');
insert into project 
