insert into project 
 values ('Αναστήλωση Φρουραρχείου Ξάνθης - Οικία Μάνου Χατζιδάκι',659480.00,'2021-12-7','2023-2-1','Ποια συγγραφής δούλευε σας λες βιαστικά κάνε. Αλγόριθμου δουλεύει το εντολές πως εκδόσεις. Που ένα στη πακέτων εφαρμογή πιο.',7,28,141,41,6,'2019-9-21','Εθνικό Δίκτυο Έρευνας και Τεχνολογίας');
insert into project 
 values ('Ανάδειξη αρχαιολογικού χώρου Δελφών',810963.00,'2021-4-11','2023-9-26','Πως μέσης εφαρμογής δουλεύει μέχρι ροή. Μη άρα υψηλότερη αθόρυβες. Εδώ άρα τεσσαρών εκτελείται αναφορά όταν που. Πάντως το έξι δουλεύει διοικητικό διαπιστώνεις κώδικάς ο.',1,22,148,48,10,'2019-9-5','Ινστιτούτο Γεωλογικών & Μεταλλευτικών Ερευνών');
