insert into project 
 values ('Σχολικό Κέντρο Καμποχώρων, Χίου',995553.00,'2022-6-26','2025-11-10','Δύο κι διακόψουμε προσλάμβανες αναγκάζονται αποστηθίσει. Άρα επιδιορθώσεις χρησιμοποίησέ κώδικα απόλαυσε μου. Τα υόρκη αρχεία ξέχασε θα ευκολότερο υποψήφιο. Διακοπής πιο μαγικά μην. Χρησιμοποιούσες ένας επιδιόρθωση εξαρτάται έρθει. Βουτήξουν γεγονός αποκλειστικούς ελέγχου δύο.',14,40,12,62,10,'2020-7-8','Δημοκρίτειο Πανεπιστήμιο Θράκης');
