insert into project 
 values ('Ηλεκτρονική Συνταγογράφηση',729612.00,'2021-4-28','2024-6-7','Του έστειλε συγχρόνως έξι άρα δύο κάτι ταξινομεί. Ίδιο σίγουρος προσεκτικά χρησιμοποιώντας εργαζόμενων ατόμου που. Με αποκλειστικούς που και χρησιμοποιούνταν. Λέει ένα ωραίο γνωστή γραμμή αποκλειστικούς ροή.',7,21,26,76,5,'2019-7-7','METRO');
