 values ('Αγροτικές ψηφιακές υπηρεσίες υψηλής προστιθέμενης αξίας',677801.00,'2022-5-18','2025-1-18','Απαράδεκτη προγραμματιστές πολύ. Κανείς χώρου παράδειγμα ποια αυτός στις έξι. Σε έστειλε δείξει δίνοντας σπίτι παράγοντες. Περίπου αγοράζοντας διοικητικό.',4,29,33,83,6,'2020-8-14','ΜΑΣΟΥΤΗΣ Α.Ε.');
