insert into project 
 values ('Επέκταση προσήνεμου μώλου στο λιμάνι της Καβάλας',415837.00,'2022-12-13','2024-10-21','Τη διοικητικό πετάνε του μηχανής. Ανεπιθύμητη περιβάλλοντος στα ας μέρος κάτι. Ίδιο από δυστυχής δούλευε μετρήσεις κι.',1,40,54,104,3,'2020-6-5','Πανεπιστήμιο Κρήτης');
