 values ('Επανέκθεση κειμηλίων Ιεράς Αρχιεπισκοπής Κρήτης στην Αγία Αικατερίνη Σιναϊτών',292485.00,'2022-4-5','2024-1-27','Προσεκτικά λαμβάνουν ένας δουλεύει υόρκη ειδικά. Ανώδυνη παραγωγικής ύψος γειτονιάς. Την στήλες πολύ ποσοστό άπειρα δημιουργια της.',15,8,103,3,2,'2020-9-16','Εθνικό και Καποδιστριακό Πανεπιστήμιο Αθηνών');
insert into project 
 values ('Ανάδειξη βόρειου ενετικού προμαχώνα Φρουρίου Ρίου',899041.00,'2022-5-18','2025-5-28','Χρονοδιαγράμματα κώδικάς ανά άρα. Γνωρίζουμε προϊόντα συνάδελφος μεταφραστής πιο ο επιχείριση. Λέει τον ωραίο είχαμε μεταγλωτιστής μια χρησιμοποιούσες. Εδώ προγραμματιστές φαινόμενο διαδίκτυο διαπιστώνεις.',4,18,110,10,8,'2020-9-2','Πανεπιστήμιο Αιγαίου');
insert into project 
 values ('Επανέκθεση συλλογών Αρχαιολογικού Μουσείου Ηρακλείου Κρήτης',181963.00,'2022-1-10','2024-8-27','Ότι ευκολότερο μα δωροδοκηθούν τη σαν. Μετρήσεις σαν φαινόμενο μη στις γνωρίζουμε εδώ τρέξει. Εγώ τις του μας πόρτες διάβασε ότι ιδιαίτερα. Μας σας της λες. Δούλευε βρίσκονται υποψήφιο προβληματική σημαντικό πόρτες τη. Αποδείξεις χρονοδιαγράμματος κοιτάζοντας απίστευτα μάλλον πεδία αναφορά.',10,33,117,17,8,'2020-4-26','Δημόσια Επιχείρηση Ηλεκτρισμού');
insert into project 
 values ('Αποκατάσταση της οικίας του Ελευθέριου Βενιζέλου στη Χαλέπα Χανίων',578762.00,'2021-4-5','2024-10-15','Έξι χρειάζονται τους έτσι διακόψουμε περιβάλλον πιο. Σου μέχρι μιας. Ένα ταξινομεί σημαντικός βαθμό μην. Νέου το ας εδώ έρθει ρουτίνα κάνε. Από στις υόρκη μιας θέλεις όσο. Αποθηκευτικού του τι.',17,14,124,24,10,'2019-1-16','ΠΑΠΑΣΤΡΑΤΟΣ');
insert into project 
 values ('Αποκατάσταση του κτιρίου του Οφθαλμιατρείου Αθηνών',126569.00,'2022-8-24','2024-9-2','Υπηρεσία εκθέσεις μας δύο εκτελέσεις. Ήδη παίξουν ήδη πλέον προγραμματιστής μου. Σταματάς κανένας πετούν του πάρα απαράδεκτη. Εργαλείων τύπου συγχρόνως μεταγλωτιστής. Ο έστειλε σταματάς συνηθίζουν πολύ εργάστηκε κι.',3,7,131,31,10,'2020-6-24','ΔΕΠΑ');
insert into project 
 values ('ΚΑΘοΔΗΓΟΣ - Ολοκληρωμένο σύστημα πληροφόρησης για τη διαθεσιμότητα θέσεων στάθμευσης',741076.00,'2022-3-15','2025-3-21','Μας πλέον πως ο ίδιο βιαστικά επί. Άπειρα συγγραφής συγκεντρωμένοι ερώτηση για πετούν φαινόμενο. Γραμμές ανά ένας προγραμματιστής ποια όσο πως θέμα. Γειτονιάς κι προσεκτικά δίνοντας. Μπουν διάβασε οι αρέσει περισσότερες. Αυτήν ακούσει περιβάλλον επί αθόρυβες.',8,8,138,38,10,'2020-9-15','Γεωδυναμικό Ινστιτούτο Εθνικού Αστεροσκοπείου Αθηνών');
insert into project 
 values ('Δομή συνεργατικών σχηματισμών Μικροηλεκτρονικής και Ενσωματωμένων Συστημάτων στην Πάτρα',563615.00,'2022-2-6','2025-9-28','Μάτσο στο πολύ έτσι εκδόσεις. Διασφαλίζεται πήρε την διαδίκτυο απλό που. Πλέον γνωστή συνεχώς σε έστελνε.',16,12,145,45,2,'2020-3-13','Ελληνικό Ινστιτούτο Παστέρ');
insert into project 
 values ('Αποπεράτωση του αυτοκινητοδρόμου Κόρινθος-Τρίπολη-Καλαμάτα και του κλάδου Λεύκτρο - Σπάρτη',609059.00,'2021-9-26','2023-1-11','Δεν στέλνοντάς μην επιχείριση χαρτιού. Κρατήσουν αλγόριθμου τα απαραίτητο εικόνες. Μέχρι ότι συνηθίζουν εκτελέσει του χάος. Της τεσσαρών δωροδοκηθούν ναι δεν δημιουργια φράση. Εταιρείες γεγονός διασφαλίζεται δημιουργήσεις αθόρυβες μαγικά. Διαφήμιση χρειάζονται περιβάλλον έτσι σχεδιαστής εργοστασίου όσο.',2,40,2,52,5,'2019-11-3','Αριστοτέλειο Πανεπιστήμιο Θεσσαλονίκης');
insert into project 
 values ('Στήριξη της γυναικείας απασχόλησης',831881.00,'2022-9-26','2024-2-11','Ας πολύ χρειάζονται. Τις διάβασε διορθώσει εδώ. Συγχρόνως ακούσει ανταγωνιστής διαπιστώνεις σημαντικός πάντως ποια. Απλό δίνοντας εκτελείται όταν εφαρμογή. Χαρτιού εργαζόμενοι πάντως μας μέρος. Ελέγχου βουτήξουν σχεδιαστής θα.',17,27,9,59,9,'2020-3-9','Πανεπιστήμιο Θεσσαλίας');
insert into project 
 values ('Επαγγελματική συμβουλευτική και κατάρτιση ανέργων της βιομηχανικής ζώνης του Πειραιά',530368.00,'2024-5-24','2027-6-21','Χάος αν παίρνουν νόμιζες έστελνε. Μια ρουτίνα δε λέει. Άρθρων αποκλειστικούς χαρακτηριστικών βασανίζουν μεταγλωτίσει. Συνεντεύξεις σημαντικό προγραμματιστές χαρακτηριστικό γραφικά.',6,8,16,66,10,'2021-11-12','ΕΛΛΗΝΙΚΑ ΠΕΤΡΕΛΑΙΑ');
insert into project 
 values ('Η Όπερα διαδραστικά στα Δημοτικά Σχολεία',324004.00,'2024-7-10','2027-4-3','Βιαστικά γνωρίζουμε τι πλέον εγώ ανά κώδικα. Φράση διορθώσεις σε ένα πάντα πρώτοι. Πετάξαμε οι νέων. Στα πρώτο μη βιαστικά. Μα από μια πολύ την.',2,36,23,73,4,'2021-9-23','ΑΒ ΒΑΣΙΛΟΠΟΥΛΟΣ');
insert into project 
 values ('Βελτίωση οδικού τμήματος Καλύβια-Λαγονήσι-Ανάβυσσος',605796.00,'2023-3-17','2025-4-27','Στο κύκλο ερωτήσεις της τύπου διάβασε. Με μέγιστη διορθώσει πάρα. Χειρότερα χάος επιδιόρθωση χαρτιού απόλαυσε πετάνε. Πιο εκθέσεις ταξινομεί πάντα κι διαχειριστής. Το θέλεις προσοχή προκύπτουν ανεπιθύμητη εργάστηκε. Χρόνου γεγονός άρα μάθε τα γραμμής.',18,24,30,80,7,'2021-12-22','ΟΜΙΛΟΣ VODAFONE');
insert into project 
 values ('Ανάδειξη των οχυρωματικών μνημείων στους μώλους του μεσαιωνικού λιμανιού της Ρόδου',393260.00,'2024-4-22','2026-11-28','Περίπου μάτσο ήδη ας γιαυτό. Εξαρτάται ειδικά παράδειγμα προσπαθήσεις. Ευκολότερο αποκλειστικούς περισσότερες εδώ κανείς.',6,7,37,87,6,'2021-2-19','Eθνικό Κέντρο Θαλασσίων Ερευνών');
insert into project 
 values ('Δημοτικό Θέατρο Πειραιά',127380.00,'2024-9-25','2026-1-22','Λες σημαντικός σου αφήσεις μας. Απόλαυσε μηχανής όσο δύο τους λες. Εκτελέσεις γραμμής που επιχείριση. Νιρβάνα σωστά τύπου περιβάλλον. Λιγότερο απαράδεκτη την.',11,37,44,94,2,'2021-8-25','Εθνικό Κέντρο Τεκμηρίωσης');
insert into project 
 values ('Συντήρηση και αναστήλωση των μνημείων της Ακρόπολης',369862.00,'2024-5-21','2026-6-1','Βιαστικά τεσσαρών δημιουργείς με. Διαδίκτυο πλέον σπίτι παράγοντες. Μου μάτσο τα συνάδελφος φράση σπίτι. Έστειλε ήδη διακόψουμε βγήκε μιας δείξει απομόνωση.',4,22,51,101,10,'2021-10-5','Εθνικό Μετσόβιο Πολυτεχνείο');
insert into project 
 values ('Ανέγερση 13ου Ολοήμερου Νηπιαγωγείου Ηρακλείου',559818.00,'2024-7-28','2027-3-2','Εκτελείται όχι λες στο. Επί προβληματική έλεγχος ελέγχου γιαυτό ας. Κάνε πρώτης πεδία υόρκη διευθυντές οι γραφικά.',8,8,58,108,9,'2021-4-24','Οικονομικό Πανεπιστήμιο Αθηνών');
insert into project 
 values ('Επέκταση βιολογικού καθαρισμού λυμάτων Γαζίου Ηρακλείου',994233.00,'2024-5-23','2026-2-7','Μην ανακλύψεις κάτι απόλαυσε. Προγραμματιστής μέχρι των σίγουρος σε απομόνωση νέο. Άτομο χρησιμοποίησέ αφήσεις αναγκάζονται χρειάζονται. Εκτελέσεις αναφέρονται πετάξαμε διασφαλίζεται στήλες γειτονιάς επιδιόρθωση. Πετάνε πετάνε των πρόσληψη θέμα εκτός. Ποια είχαμε προσοχή μετρήσεις.',11,14,65,115,6,'2021-3-4','Πολυτεχνείο Κρήτης');
insert into project 
 values ('Βιοκλιματικό Δημοτικό Σχολείο Συκεών Θεσσαλονίκης',655459.00,'2024-8-11','2027-4-25','Μηχανής εκτός έστειλε έτοιμος. Ρωτήσει ένα συνεντεύξεις μιας ιδιαίτερα. Πήρε μη διακοπή διασφαλίζεται. Τεσσαρών ευκολότερο υπηρεσία άρα οι τα της.',2,34,72,122,4,'2021-7-4','ΕΛΙΝΟΙΛ');
insert into project 
 values ('Χώρος Υγειονομικής Ταφής Αποβλήτων (ΧΥΤΑ) Ιωαννίνων',918117.00,'2024-11-19','2026-2-5','Νέο δημιουργήσεις πως αναφέρονται σου. Ίδιο διαδίκτυο ρωτάει τεσσαρών μια έρθει. Το δε ποσοστό έστελνε. Επενδυτής εφαρμογής μέχρι συγχωνευτεί ότι. Δε σημεία στο πάντα.',13,37,79,129,10,'2021-8-5','ΚΑΠΝΟΒΙΟΜΗΧΑΝΙΑ ΚΑΡΕΛΙΑ');
insert into project 
 values ('Δίκτυα αποχέτευσης και εγκατάσταση επεξεργασίας λυμάτων του Δήμου Κοζάνης',782846.00,'2024-6-28','2027-10-5','Πρώτης πάρεις ανακλύψεις ποια τέλειοι περισσότερες. Μη γεγονός μιας σίγουρος μετράει παραπάνω ανά. Έρθει παραπάνω δεδομένων κάνεις. Εφαρμογής στο μεταγλωτίσει στα δουλεύει την την.',6,30,86,136,3,'2021-10-23','Eθνικό Αστεροσκοπείο Αθηνών');
insert into project 
 values ('Λιμενική εγκατάσταση κρουαζιεροπλοίων στο λιμάνι Αργοστολίου, Κεφαλονιά',547337.00,'2024-7-13','2026-2-21','Εκτελέσεις σαν επενδυτής επιδιορθώσεις την όσο. Οι εκτελέσεις υποψήφιο δημιουργήσεις έλεγχος. Εκδόσεις αγοράζοντας μιας πολύ. Δωροδοκηθούν αθόρυβες βαθμό τους εργαλείων τέλειοι.',8,15,93,143,9,'2021-6-25','Εθνικό Κέντρο Κοινωνικών Ερευνών');
insert into project 
 values ('Μέγαρο Χορού Καλαμάτας',670031.00,'2024-8-14','2027-4-5','Γράψει εγώ ερώτηση προβληματική πάντα ανά. Πως δυστυχής τρόποι. Παράγοντες τα μέχρι.',17,40,100,150,1,'2021-7-2','Ινστιτούτο Συστημάτων Επικοινωνιών και Υπολογιστών');
insert into project 
 values ('Ανακαίνιση της Πορφυριάδας Σχολής στο Καρλόβασι Σάμου',977705.00,'2023-7-3','2026-4-21','Όταν πετούν άρθρων εδώ διαχειριστής πλέον. Γνωστή κάνεις αποθηκευτικού. Πλέον μάθε συγκεντρωμένοι παίρνουν να συνάδελφος άπειρα τους. Πάντως μας τα παραδοτέου πάντως. Χρονοδιαγράμματος στο έγραψες τρόπο μια εκδόσεις.',3,10,107,7,7,'2021-1-25','Ιατρική Σχολή Αθηνών');
insert into project 
 values ('Διαμόρφωση χερσαίων χώρων στο παλιό λιμάνι Μυκόνου',863944.00,'2024-1-15','2027-2-15','Ποσοστό υποψήφιο επιστρέφουν για δημιουργήσεις αγοράζοντας πες. Χρησιμοποιούσες δύο πως. Νόμιζες ερώτηση μέγιστη εκτός πηγαίου πάντως δύο. Αναφορά πιο τις στέλνοντάς. Έτσι συνέχεια στη. Εικόνες ποσοστό απαράδεκτη δουλεύει.',7,39,114,14,7,'2021-7-1','Χαροκόπειο Πανεπιστήμιο Αθηνών');
insert into project 
 values ('Αξιοποίηση γεωθερμικού πεδίου Ερατεινού, Δήμου Νέστου',659480.00,'2023-4-17','2025-8-27','Μάτσο ένας διακόψουμε λοιπόν εδώ νέου εδώ. Στήλες κρατήσουν σου πλέον. Εκτός βασανίζουν μετράει.',20,9,121,21,4,'2021-6-25','ΕΛΒΑΛΧΑΛΚΟΡ');
insert into project 
 values ('Διαχείριση πόσιμου νερού Λαμίας',810963.00,'2024-4-28','2027-5-3','Περιμένουν χαρακτηριστικών θέματα ο ατόμου χάος προσοχή εργαζόμενων. Εδώ πιο τα. Ποια πως σου βιαστικά προσοχή εκείνου στήλες.',1,18,128,28,4,'2021-2-28','ΟΜΙΛΟΣ MARFIN');
insert into project 
 values ('Επέκταση της Γραμμής 3 του Μετρό Αθήνας, τμήμα Αιγάλεω - Αγία Μαρίνα',464723.00,'2023-1-1','2025-8-16','Διολισθήσεις στη ας. Χρησιμοποιούσες άπειρα φίλος επιστρέφουν καταλάθος πως διορθώσεις διάβασε. Τα κώδικα τους μερικούς ίδιο άρα. Ανώδυνη συγγραφείς σας να ατόμου.',6,34,135,35,3,'2021-1-19','REVOIL Α.Ε.Ε.Π.');
insert into project 
 values ('Εναρμόνιση οικογενειακής και επαγγελματικής ζωής',995553.00,'2023-3-22','2025-1-8','Χρονοδιαγράμματα δύο στα ημέρα προσπαθούν ζητήσεις αντιλήφθηκαν. Επιδιόρθωση στο εκείνου ελέγχου εφαρμογής. Κι εργοστασίου εκτελέσει εκδόσεις εκτελείται. Επί που συνεντεύξεις.',20,31,142,42,4,'2021-5-2','Εθνικό Κέντρο Έρευνας Φυσικών Επιστημών ΔΗΜΟΚΡΙΤΟΣ');
insert into project 
 values ('Ίδρυμα Τεχνολογίας Έρευνας, Ινστιτούτο Πληροφορικής - Κτίριο Διάχυτης Νοημοσύνης',106807.00,'2024-11-9','2026-4-22','Επιστρέφουν εργασίας προβληματική προγραμματιστής. Συνεντεύξεις νέα που του στέλνοντάς δεν διαφήμιση. Κανένας σε λίγο εκθέσεις σταματάς. Επί συνηθίζουν εφαμοργής μέσης διάβασε.',20,6,149,49,2,'2021-7-1','Ινστιτούτο Δασικών Ερευνών');
insert into project 
 values ('Νέα προμήθεια Λεωφορείων για τις Οδικές Συγκοινωνίες',995106.00,'2023-9-9','2025-12-15','Πλέον συγγραφής γραμμές. Ιδιαίτερα επενδυτής σαν πες εσωτερικών μην. Πόρτες κρατάει προκαλείς αποθηκευτικού για. Φακέλους διαφήμιση αναφορά περιεχόμενα τι προσθέσει. Έχω συνέχεια μου ότι πολύ αν σχεδιαστής. Γειτονιάς στα απλό αυτός τον αρπάζεις ένας μάλλον.',19,15,6,56,1,'2021-10-15','Πανεπιστήμιο Πατρών');
insert into project 
 values ('Αποπεράτωση ηλεκτροκίνησης διπλής σιδηροδρομικής γραμμής στο τμήμα ΣΚΑ - Κιάτο',902801.00,'2023-4-6','2025-11-25','Ωραίο πάντως υπηρεσία. Περισσότερες χαρακτηριστικών στέλνοντάς επιστρέφουν φαινόμενο πάρα διοικητικό. Κάτι ανεπιθύμητη περισσότερες ποια. Άτομο και το βιβλίο από επιχείριση να αποστηθίσει. Θα γνωρίζουμε εκτελέσει όσο δύο ειδικά προβληματική.',12,3,13,63,9,'2021-9-1','Πανεπιστήμιο Μακεδονίας');
insert into project 
 values ('Σταθμός συμπίεσης φυσικού αερίου στη Νέα Μεσημβρία (Θεσσαλονίκη)',717274.00,'2024-9-3','2026-9-23','Έξι όχι αναφορά εκείνου. Φαινόμενο από επιδιόρθωση κώδικα. Ανεπιθύμητη φίλος στο κάτι όχι. Γνωρίζουμε όσο την φαινόμενο παίξουν προσπαθούν σπίτι.',3,3,20,70,1,'2021-9-23','ΣΚΛΑΒΕΝΙΤΗΣ');
insert into project 
 values ('Αγωγός φυσικού αερίου υψηλής πίεσης προς Αλιβέρι',940762.00,'2024-3-10','2026-11-16','Εκτελέσεις αποφάσισε άρα πιο λίγο λιγότερο. Όχι οι απίστευτα και ανά μα έξι. Τις κάτι διακοπή κρατήσουν σημαντικός οι χρησιμοποίησέ. Πάρα λες εξοργιστικά τρόποι μέσης δεδομένων. Έτσι κοιτάζοντας επεξεργασία μιας ως. Του σπίτι μη πετάνε αυτήν κάτι.',16,3,27,77,3,'2021-3-27','ΕΛΛΗΝΙΚΗ ΕΤΑΙΡΕΙΑ ΣΥΜΜΕΤΟΧΩΝ');
insert into project 
 values ('Ολοκλήρωση Γενικού Νοσοκομείου Αγρινίου',512462.00,'2024-6-22','2027-1-10','Κάτι μεταγλωτιστής μου κάνε πρώτης. Εργαζόμενων πάρεις άρθρων κύκλο ναι εγώ. Μεταγλωτιστής μην σε μέχρι μα δημιουργια τύπου. Του από λέει εδώ στη τα. Θέματα κι να παίρνουν κι οι μετράει.',8,22,34,84,7,'2021-8-22','INTRALOT Α.Ε.');